import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

function YourNextOrder(props) {
    return (
        <View style={styles.orderContainer}>
            <View style={styles.orderScreenText}>
                <Text style={styles.orderScreenText}>Your next order</Text>
                <Text style={styles.orderScreenText}>The monthly order consists of 5 plants.
                    Changes to your next order can be made until the end of {'bla'}.
                    This order will be shipped on the beginning of {'koko'}.</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    orderContainer: {
        flex: 1,
        height: '50%',
        width: '100%',
        backgroundColor: 'rgba(247,245,255,1)',
    },
    orderScreenText: {

    }
})

export default YourNextOrder;
